const dotenv = require('dotenv');
dotenv.config();

const host = process.env.HSERVER_HOST;


const createRestaurant = `${host}/restaurantes`;
const listRestaurants = `${host}/restaurantes/lista`;
const listRestaurantsByName = `${host}/restaurantes/lista/nombres`;
const listRestaurantsByCity = `${host}/restaurantes/lista/ciudades`;

const makeReserve = `${host}/reservas`;
const listReserves = `${host}/reservas/lista`;

module.exports = { createRestaurant, listRestaurants, listRestaurantsByName, listRestaurantsByCity, makeReserve, listReserves }
